import React from 'react';
import "bootstrap/dist/css/bootstrap.min.css";
import {BrowserRouter as Router, Route, Redirect, Switch}from  'react-router-dom';
import Home from './components/pages/home.component';
import Navbar from './components/style/navbar.component';
import Registration from './components/pages/registration.component';
import Clients from './components/pages/clients.component';
import Edit from './components/pages/edit.component'


const App=()=> {
  return (
    <Router>
      <Switch>
        <Navbar/>
        <div className="container">
              <Route path="/"><Home/></Route>
              <Route path="/registration"><Registration/></Route>
              <Route path="/clients"><Clients/></Route>
              <Route path="/edit:id"><Edit/></Route>
          <Redirect to="/"/>
        </div>
      </Switch>
    </Router>
  );
} 

export default App;
